ALTER SESSION SET NLS_DATE_FORMAT='DD/MM/YYYY';
SET LINESIZE 120
SET PAGESIZE 100

CREATE TABLE Supplier(
   supplier_id    VARCHAR(7)  NOT NULL PRIMARY KEY,
   supplier_name  VARCHAR(34) NOT NULL,
   contact_number VARCHAR(12) NOT NULL,
   email          VARCHAR(35) NOT NULL,
   address        VARCHAR(49) NOT NULL,
   CONSTRAINT supplier_chk_id              CHECK (REGEXP_LIKE(supplier_id, '^S\d{6}$')),
   CONSTRAINT supplier_chk_contact_number  CHECK (REGEXP_LIKE(contact_number, '^(01[(2-90)]-\d{7})$|^(011-\d{8})$')),
   CONSTRAINT supplier_chk_email           CHECK (REGEXP_LIKE(email,'^[a-zA-Z]\w+@(\S+)$'))
);

select count(*) as totalSupplierRecords from Supplier;
